import React from "react";
import "./style.css";
import StartPage from "./elements/StartPage/StartPage";
import HeaderMenu from "./elements/Header/HeaderMenu";
import AboutPage from "./elements/AboutPage/About";
import { Parallax, ParallaxLayer } from "@react-spring/parallax";

export default function MainPage() {
  return (
    <div className="main-page">
      <HeaderMenu />
      <Parallax pages={2}>
        <ParallaxLayer speed={1} factor={1} sticky={{start:2, end: 0.1}}>
          <StartPage />
        </ParallaxLayer>

        <ParallaxLayer offset={1} speed={0.5} factor={1}>
          <AboutPage />
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}
